import React from "react";
import "./home.css";
import { TypeAnimation } from 'react-type-animation';

function Home() {
  return (
    <div className="home-section">
      <header className="App-header">
        <div className="text">
          <p className="hi">Hi! My name is</p>
          <p className="my-name anim-typewriter">
            Kinton Duong
          </p>
        </div>


      </header>
    </div>
  );
}

export default Home;
